import './main.css';

function Keyword() {
  return (
    <div>
       <h1 class="top-heading"> <img
                  src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
                  width="50"
                  height="55"
                  alt="MoodMelody Logo"
                /> MoodMelody </h1>
      <p>This is the Keywords page.</p>
    </div>
  );
}
export default Keyword;
